GFL_RECT *new_Rect (GFL_INT32 x,GFL_INT32 y,GFL_INT32 w,GFL_INT32 h)
{
	GFL_RECT rect;
	GFL_RECT *rectPtr;
	rect.x = x;
	rect.y = y;
	rect.w = w;
	rect.h = h;
	rectPtr = (GFL_RECT *)gflMemoryAlloc(sizeof(GFL_RECT));
	return (GFL_RECT *)memmove( rectPtr, &rect, sizeof(GFL_RECT));
}

